import React from 'react'
import {getTodos} from '../services/getRequests.js'
import { useState, useEffect } from 'react'

 function Todos() {
    const [todos, setTodos] = useState([])

      useEffect(() => {
          getTodos()
        .then(res => res.json())
        .then(res => setTodos(res))
      }, [])
    //console.log(todos)


    return (
      <div className="">
        <nav className="nav">
        <h1>To_Do List</h1>
        <form>
            <input placeholder="Task" />
            <button type="submit"> Add Task </button>
        </form>
        </nav>
      <ul>
      {todos.map((todo, i) => {
            return(
                <ul>

                    <li key= {i}>
                       <h3></h3>
                    </li>
                </ul>
                );
            })}
      </ul>
      </div>
    );
  }

  export default Todos;
